  function vehicleinrom_gps_temp($dbtable, $starttime, $wherenya){
    $this->vehicledblive     = $this->load->database($dbtable, true);
    $this->vehicledblive->select("*");
    $this->vehicledblive->where("gps_tmp_geofence", $wherenya);
